    private static void OnNpcCommand(GatewayConnection connection, string[] commandArgs)
    {
        if (commandArgs.Length < 2)
            return;

        switch (commandArgs[1])
        {
            case "count":
                {
                    var packet = new PacketChat
                    {
                        Channel = Packet.Common.Chat.ChatChannel.System,
                        ToGuid = connection.Player.Guid,
                        Message = $"Npcs Visible: {connection.Player.VisibleEntities.Count}"
                    };

                    connection.Player.SendTunneled(packet);
                }
                break;

            case "spawn":
                {
                    if (commandArgs.Length < 4)
                        return;

                    if (!int.TryParse(commandArgs[2], out var nameId))
                        return;

                    if (!int.TryParse(commandArgs[3], out var modelId))
                        return;

                    if (connection.Player.Zone.TryCreateNpc(out var npc))
                    {
                        npc.Visible = true;

                        npc.NameId = nameId;
                        npc.ModelId = modelId;

                        npc.Position = connection.Player.Position;
                        npc.Rotation = connection.Player.Rotation;

                        npc.Scale = 1f;
                        npc.Disposition = 2;

                        npc.CompositeEffectId = 2100;

                        npc.TextureAlias = commandArgs.Length != 5 ? string.Empty : commandArgs[4];
                    }
                }
                break;

            case "clearall":
                {
                    foreach (var entity in connection.Player.Zone.Entities)
                    {
                        if (entity is Npc npc)
                            connection.Player.Zone.RemoveEntity(npc);
                    }
                }
                break;

            case "spawnall":
                {
                    var modelId = 1;

                    var test = 0;

                    for (var x = 0; x < 61; x++)
                    {
                        for (var z = 0; z < 61; z++)
                        {
                            // if (test > 70)
                            // return;

                            if (!_resourceManager.Models.TryGetValue(modelId++, out var model))
                                continue;

                            // if (!model.ModelFileName.Contains("human"))
                            // continue;

                            if (connection.Player.Zone.TryCreateNpc(out var npc))
                            {
                                npc.Visible = true;

                                npc.Name = modelId.ToString();
                                npc.ModelId = modelId;

                                npc.Position = new System.Numerics.Vector4(connection.Player.Position.X - (x * 10), connection.Player.Position.Y, connection.Player.Position.Z + (z * 10), connection.Player.Position.W);

                                npc.Rotation = connection.Player.Rotation;

                                npc.Scale = 1f;
                                npc.Disposition = 1;
                            }

                            test++;

                            if (modelId == 3831)
                                return;
                        }
                    }
                }
                break;

            default:
                {
                    var packet = new PacketChat
                    {
                        Channel = Packet.Common.Chat.ChatChannel.System,
                        ToGuid = connection.Player.Guid,
                        Message = $"Invalid npc command. ({commandArgs[1]})"
                    };

                    connection.Player.SendTunneled(packet);
                }
                break;
        }
    }
